function App() {
  return (
    <div className="App">
      <ContextProvider>
        <ExtendTrack style={{display: 'inline'}} />
        <AddVoice style={{display: 'inline'}} />
        <Play />
        <Matrix />
      </ContextProvider>
    </div>
  );
}

export default App;
